import styled from "styled-components";

export const Section = styled.section`
  width: 80%;
  margin: 0 auto;
  margin-top: 180px;
  margin-bottom: 120px;
  display:flex;
  justify-content:space-between;
  flex-wrap:wrap;

`;
export const Pagination = styled.section`
  margin: 0 auto;
  margin-top: 70px;
  margin-bottom: 70px;
  border:1px solid red;

`;
